- BHPC's maple script `outputC_Slm_Zlmkn.mw`.


25th May 2020; RF
12th June. 2020; Sis


Convention (the phase `B_inc`  is defined in `Zlmkn8.c`):
 Zlmkn8  = ( hat_Zlmkn8 * exp(-I * B_inc) )

 For ell = 3, we have only
 0 <= |k| <= 10 (jmax = 7)
 
 //Shorthad variables for PN amplitudes  in `inspiral_orb_data`
